  return (
    <div className="navigation">
      {/* <div className='picture'> */}
      <img src={img} alt="2r" />
      {/* </div>  */}
      <NavLink exact to="/Acceuil">
        Acceuil
      </NavLink>
      <NavLink exact to="/Ressources">
        Ressources
      </NavLink>
      <NavLink exact to="/Contacts">
        Contact
      </NavLink>

      <NavLink exact to="/">
        Connexion
      </NavLink>
    </div>
  );
};

export default Navigation;
